import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from '../api/axiosInstance';
import '../App.css';
import { toast } from 'react-toastify';

const TirCreate: React.FC = () => {
  const navigate = useNavigate();
  const [tirBean, setTirBean] = useState({
    portataMax: '',
    numeroAssi: '',
    cilindrata: '',
    lunghezza: '',
    altezzaCassone: '',
    extTipoAlimentazioneId: '',
    extMotoreEuroId: '',
    extTipoRimorchioId: ''
  });

  const [mezzoBean, setMezzoBean] = useState({
    marca: '',
    modello: '',
    targa: '',
    colore: '',
    annoImmatricolazione: new Date().getFullYear(),
    dataAcquisto: '',
    prezzo: 0
  });

  const [alimentazioni, setAlimentazioni] = useState<any[]>([]);
  const [motori, setMotori] = useState<any[]>([]);
  const [rimorchi, setRimorchi] = useState<any[]>([]);
  const [error, setError] = useState('');

  useEffect(() => {
    axios.get('/automezzi/findAllTipoAlimentazione')
      .then(res => setAlimentazioni(res.data.tipoAlimentazioneBeanList || []));

    axios.get('/automezzi/findAllMotoreEuro')
      .then(res => setMotori(res.data.motoreEuroBeanList || []));

    axios.get('/automezzi/findAllTipoRimorchio')
      .then(res => setRimorchi(res.data.tipoRimorchioBeanList || []));
  }, []);

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    setError('');

    axios.post('/automezzi/insertTir', { tirBean, mezzoBean })
      .then(res => {
        if (res.data.errorCode === 0) {
          toast.success('✅ Tir creato con successo');
          navigate('/dashboard');
        } else {
          setError(res.data.errorMessage);
        }
      })
      .catch(() => setError('Errore durante la creazione del tir'));
  };

  return (
    <div className="form-container">
      <h2>Crea Tir</h2>
      <form onSubmit={handleSubmit}>
        <h4>Dati Mezzo</h4>
        <input placeholder="Marca" value={mezzoBean.marca} onChange={e => setMezzoBean({ ...mezzoBean, marca: e.target.value })} required />
        <input placeholder="Modello" value={mezzoBean.modello} onChange={e => setMezzoBean({ ...mezzoBean, modello: e.target.value })} required />
        <input placeholder="Targa" value={mezzoBean.targa} onChange={e => setMezzoBean({ ...mezzoBean, targa: e.target.value })} required />
        <input placeholder="Colore" value={mezzoBean.colore} onChange={e => setMezzoBean({ ...mezzoBean, colore: e.target.value })} required />
        <input type="number" placeholder="Anno Immatricolazione" value={mezzoBean.annoImmatricolazione} onChange={e => setMezzoBean({ ...mezzoBean, annoImmatricolazione: parseInt(e.target.value) })} required />
        <input type="date" placeholder="Data Acquisto" value={mezzoBean.dataAcquisto} onChange={e => setMezzoBean({ ...mezzoBean, dataAcquisto: e.target.value })} />
        <input type="number" placeholder="Prezzo" value={mezzoBean.prezzo} onChange={e => setMezzoBean({ ...mezzoBean, prezzo: parseFloat(e.target.value) })} required />

        <h4>Dati Tir</h4>
        <input type="number" placeholder="Portata Max" value={tirBean.portataMax} onChange={e => setTirBean({ ...tirBean, portataMax: parseFloat(e.target.value) })} required />
        <input type="number" placeholder="Numero Assi" value={tirBean.numeroAssi} onChange={e => setTirBean({ ...tirBean, numeroAssi: parseInt(e.target.value) })} required />
        <input placeholder="Cilindrata" value={tirBean.cilindrata} onChange={e => setTirBean({ ...tirBean, cilindrata: e.target.value })} required />
        <input placeholder="Lunghezza" value={tirBean.lunghezza} onChange={e => setTirBean({ ...tirBean, lunghezza: e.target.value })} required />
        <input placeholder="Altezza Cassone" value={tirBean.altezzaCassone} onChange={e => setTirBean({ ...tirBean, altezzaCassone: e.target.value })} required />

        <select value={tirBean.extTipoAlimentazioneId} onChange={e => setTirBean({ ...tirBean, extTipoAlimentazioneId: parseInt(e.target.value) })} required>
          <option value="">Seleziona Alimentazione</option>
          {alimentazioni.map(a => <option key={a.idTipoAlimentazione} value={a.idTipoAlimentazione}>{a.descrizione}</option>)}
        </select>

        <select value={tirBean.extMotoreEuroId} onChange={e => setTirBean({ ...tirBean, extMotoreEuroId: parseInt(e.target.value) })} required>
          <option value="">Seleziona Motore Euro</option>
          {motori.map(m => <option key={m.motoreEuroId} value={m.motoreEuroId}>{m.descrizione}</option>)}
        </select>

        <select value={tirBean.extTipoRimorchioId} onChange={e => setTirBean({ ...tirBean, extTipoRimorchioId: parseInt(e.target.value) })} required>
          <option value="">Seleziona Tipo Rimorchio</option>
          {rimorchi.map(r => <option key={r.tipoRimorchioId} value={r.tipoRimorchioId}>{r.descrizione}</option>)}
        </select>

        <button type="submit">Crea Tir</button>
        {error && <p className="error-text">{error}</p>}
      </form>
    </div>
  );
};

export default TirCreate;
